TUESDAY BONUS UPDATE: Two Unfinished Matches for Your Viewing Pleasure

Sep 4, 2012 - Performers: Gia DiMarco and Mahina Zaltana 


WMV only, MP4 + Pics later.



Due to factors beyond our control last month's Tag Team Match Up was cancelled, and has been rescheduled for this coming Friday. Stay tuned for the first round next Tuesday. In lieu of the Tag Team Match for this week we have edited together a bonus update for you of unfinished matches. To ensure that you get your weekly Tuesday update we have edited together two unfinished matches for your viewing pleasure! 

Tia aka 'Jade' is back and ready to kick some ass, but rookie Lizzy 'The Lethal' London can't take the heat. It's a close match with pussy rubbing, submission holds, and bitchy attitude. The match was called due to anger issues...lesson learned: if you can't take it, then get off the mat. Mahina Zaltana takes on Gia DiMarco and these hotties are well matched. Unfortunately, Gia is injured before the end of Round 1, but returns to wrestle another day.

